import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';

import CreationSingle from '../creation/creationSingle/creationsingle';

import "./single.css"
class Single extends Component {
    componentDidMount() {
        let { corgis } = this.props
        let loc = Number(this.props.location.hash.slice(1))
        let corgi = corgis.filter((corgi, index) => index === loc)
        console.log(loc, corgi[0])
    }
    render() {
        let { corgis, login } = this.props
        let loc = Number(this.props.location.hash.slice(1))
        let corgi = corgis.filter((corgi, index) => index === loc)[0]
        if (!login) { return <Redirect to="/" /> }
        return (
            <div>
                <div>
                    <h1>Meet {corgi.name}!</h1>
                    <div style={{margin: "3%"}}>
                        <CreationSingle
                            backgroundColor={corgi.backgroundColor}
                            color={corgi.color}
                            sausage={corgi.sausage}
                            des={corgi.quote} />
                    </div>
                    <div style={{ display: "flex", flexDirection: "row", margin: "auto", width: "90%" }}>
                        <Rate />
                        <SendAndShare />
                    </div>
                </div>
            </div>
        )
    }

}

